import Container from "../components/general_components/Container";

const ScreenSaver = () => {
  return (
    <>
      <Container title="Background">
        <div className="bg">
          <img
            src="/images/foto4.jpg"
            alt=""
            style={{ width: "200px", height: " 400px", objectFit: "cover" }}
          />
        </div>
      </Container>
    </>
  );
};

export default ScreenSaver;
